import React from "react";
import "./Dialogs.css";
import Slider from "./Slider/Slider";
import Chat from "./Chat/Chat";

const Dialog = (props) => {

    return (
        <div className="app-dialog">
            <Slider />
            <div className="border"></div>
            <Chat messages={props.messages} />
        </div>
    );
}

export default Dialog;
